import prettyReact from './images/pretty-react-logo.png.svg'

export default function NavBar() {
  return (
   <div className='new'>
        <img src={ prettyReact } alt='React logo'/>
        <button onclick={function () {document.getElementsByTagName('img').style.width = "30px"}} className='button'>Click me</button>
   </div>
  );
};
